import CsvUpload from './CsvUpload'
import React, { useState } from 'react'


const Entry = () => {
    const [myData, setMyData] = useState({})

    const convertToObject = (anArray) => {
        var data = anArray,
        keys = data.data[0],
        result = data.data.slice(2).map(function (a) {
            var temp = {};
            keys.forEach(function (k, i) {
                temp[k] = a[i];
            })
            return temp;
        });

    setMyData( result)

    }

    return(
        <div>
        Hi
        <CsvUpload convertToObject = {convertToObject}/>

        {myData.map}
        </div>
    )
}

export default Entry
